import React from 'react'
import Project from './Projects'
import styled from 'styled-components'
import { courseData } from '../data/projects'

const Total = styled.div`
z-index:2;
width: 2300px;
overflow: scroll;
display: flex;
color: #1F1D1D;
&::-webkit-scrollbar {
display: none;
}
`

const Wrapper = styled.div`
margin-top: 1230px;
width: 2400px;
height: 500x;
margin-left:12px;
padding-left:1px;
`

const Outline = styled.div`
margin-left:12px;
width: 1300px;
height: 250px;
padding-left:6px;
padding-right: 10px;
border: 2px dashed black;
`

const Projectsmap = () => {
  return (
    <Wrapper>
      <Outline>
      <Total>
        {courseData.map(course => <Course courseName={course.name} key={course.coursecCode} />)}
      </Total>
      </Outline>
    </Wrapper>
  )
}

export { courseData }
export default Projectsmap
